import React, { Component } from 'react'

type AboutCardProps = {
    title: string;
    description: string;
}

type AboutCardState = {};

export default class AboutCard extends Component<AboutCardProps, AboutCardState> {
  render() {
    return (
      <div className='w-full rounded-lg h-auto border-2 border-slate-800'>
        <h2 className='pt-9 text-center font-bold text-xl'>{this.props.title}</h2>
        <p className='ptext-center font-semibold '>{this.props.description}</p>
      </div>
    )
  }
}
